import React from "react";
import logo from "../img/logo.svg"

const Header = function () {
    return (
        <div className="header">
            <div className="logo">
                <img src={logo} alt="Logo"/>
                <p>текст</p>
            </div>
        </div>
    );
}
export default Header;
